import React, { useState, useEffect } from 'react'
import Select from 'react-select';
import Checkbox from '@material-ui/core/Checkbox';
import Container from '@material-ui/core/Container';


export default function Header() {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('http://www.mocky.io/v2/5c9105cb330000112b649af8')
        .then(res =>{
            return res.json()
        })
        .then(response =>{
            setData(response.furniture_styles)
        })
        }, [])



    const optionSelect = data.map(item =>{
        return (
            <div>
                <p>
                    {item}
                </p>
                <Checkbox value="uncontrolled" inputProps={{ 'aria-label': 'uncontrolled-checkbox' }} />
            </div>
        )
    })



    return (
        <div>
            <Container fixed>
                <div>
                    <Select options={optionSelect}/>
                </div> 
            </Container>
        </div>
    )
}
